import React from "react";

export default function FixedIcons() {
  return (
    <div className="icon-cointainer">
      <a
        href="https://github.com/signekp"
        target="_blank"
        rel="noreferrer"
        className="github-icon"
      >
        <i className="fa-brands fa-github"></i>
      </a>
    </div>
  );
}
